import React from 'react'
import { Link } from 'react-router-dom'

export function Toolbar({ setFavoritesList }) {
    return (
        <div className="modal-bar">
            <Link onClick={() => setFavoritesList(false)}>Home page</Link>
            <Link>Library</Link>
            <Link>History</Link>
            <Link to="/favorites">Videos I liked</Link>
        </div>
    )
}
